import React from 'react'

const Inicio = () => {
    return (
        <div>
            <h1>Pagina de Inicio</h1>
            <a href="/registro">Registro</a>
            <a href="/login">Iniciar Sesion</a>
        </div>
    )
}

export default Inicio;
